import React, { Component } from "react";
import Courselist from "../courselist/courselist";
import Navbar from "../navbar/navbar";
import "./App.css";

class App extends Component {
  state = {
    courses: [
      { name: "Algo", url: "https://www.youtube.com" },
      { name: "OODP", url: "" },
      { name: "Jing Wen", url: "" }
    ]
  };
  render() {
    return (
      <div>
        <Navbar />
        <Courselist courses={this.state.courses} />
        <div id="wtEmbedCode">
          <script
            type="text/javascript"
            id="embedded_forum"
            src="https://wastedpotnetial.discussion.community/js/mb/embed.js"
          ></script>
          <noscript>
            <a href="https://wastedpotnetial.discussion.community/">
              The Community Forum
            </a>
          </noscript>
        </div>
      </div>
    );
  }
}

export default App;
